import React from 'react';
import './styles.css';
import wordazul from './assets/wordazul.png';
import { useNavigate } from 'react-router-dom';

const Header = () => {
    const navigate = useNavigate();

    const handleHowToUse = () => {
        navigate('/how-to-use-page');
    }

    const handleAboutUs = () => {
        navigate('/about-us-page');
    }

    const handleAlgorithm = () => {
        navigate('/algorithm');
    }

    return (
        <div className="navbar-container">
            <img src={wordazul} alt="Word Azul" className='wordazul'/>
                <button className="header-button" onClick={handleHowToUse}>
                    How to Use
                </button>
                <button className="header-button" onClick={handleHowToUse}>
                    Algorithm
                </button>
                <button className="header-button" onClick={handleAboutUs}>
                    About Us
                </button>
        </div>
    );
}

export default Header;
